geregisseerd door Xavier Gens
met Lauren German, Michael Biehn en Rosanna Arquette



Een enorme explosie vindt plaats in New York. Acht vreemden verschuilen zich in de kelder van het appartementencomplex waar ze wonen. Ze hebben voedsel en water genoeg en zijn tenminste veilig van de vreselijke gebeurtenissen die buiten plaatsvinden. Maar dan stormen er plotsklaps mannen in HAZMAT-uniformen de kelder binnen en openen het vuur. De groep vreemden besluit hun krachten te bundelen, om de onbekende vijand een lesje te leren. Maar wie zijn deze HAZMATS, wat willen ze en waarom zijn ze zo genadeloos?



